import React from 'react';
import './ContactUs.css';

 const ContactUs =() => {
  return (
  <div className='contact'>
  <form className="form">
    <h1> Contact Form</h1>

    <label> Name </label>
    <input placeholder="Name"/>

    <label> Email </label>
    <input placeholder="Email"/>

    <label> Message </label>
    <textarea placeholder="Message"></textarea>

    <button>Sub</button>

  </form>
  </div>

  )
}

export default ContactUs;
